import React from "react";
import PartnerRegister from './PartnerRegister';

function YouthRegister(){
    return(
        <div className="YouthRegister">
            <h1>This is the Youth Register page</h1>

            <input type="text" placeholder="Full name"/>
            <input type="text" placeholder="Email"/>
            <input type="password" placeholder="Password"/>
            <button>Login</button>

            <label>Sign in as partner<li><Link to="/partnerRegister">Register for partners</Link></li></label>
            
        </div>
    );
}
// delete all of this
export default YouthRegister;
